{"$schema": "http://json-schema.org/draft-07/schema#",
  "$defs": {
    "Author": {
      "description": "Represents an author on a library card.\n\nAttributes:\n    last_name: Author's last name\n    first_name: Author's first name",
      "properties": {
        "last_name": {
          "title": "Last Name",
          "type": "string"
        },
        "first_name": {
          "title": "First Name",
          "type": "string"
        }
      },
      "required": [
        "last_name",
        "first_name"
      ],
      "title": "Author",
      "type": "object"
    },
    "LibraryReference": {
      "description": "Represents library-specific reference information.\n\nAttributes:\n    shelfmark: Library shelfmark or call number\n    subjects: Subject classifications or tags",
      "properties": {
        "shelfmark": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Shelfmark"
        },
        "subjects": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Subjects"
        }
      },
      "title": "LibraryReference",
      "type": "object"
    },
    "Publication": {
      "description": "Represents publication information from a library card.\n\nAttributes:\n    title: Title of the publication\n    year: Year of publication\n    place: Place of publication\n    pages: Number of pages or page range\n    publisher: Publisher name\n    format: Format of the publication\n    editor: Editor name if applicable",
      "properties": {
        "title": {
          "title": "Title",
          "type": "string"
        },
        "year": {
          "title": "Year",
          "type": "string"
        },
        "place": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Place"
        },
        "pages": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Pages"
        },
        "publisher": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Publisher"
        },
        "format": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Format"
        },
        "editor": {
          "anyOf": [
            {
              "type": "string"
            },
            {
              "type": "null"
            }
          ],
          "default": null,
          "title": "Editor"
        }
      },
      "required": [
        "title",
        "year"
      ],
      "title": "Publication",
      "type": "object"
    },
    "WorkType": {
      "description": "Represents the type of work referenced in a library card.\n\nAttributes:\n    type: Type of work, either \"Dissertation or thesis\" or \"Reference\"",
      "properties": {
        "type": {
          "enum": [
            "Dissertation or thesis",
            "Reference"
          ],
          "title": "Type",
          "type": "string"
        }
      },
      "required": [
        "type"
      ],
      "title": "WorkType",
      "type": "object"
    }
  },
  "description": "Represents a complete library card document.\n\nAttributes:\n    type: Type of work\n    author: Author information\n    publication: Publication details\n    library_reference: Library reference information",
  "properties": {
    "type": {
      "$ref": "#/$defs/WorkType"
    },
    "author": {
      "$ref": "#/$defs/Author"
    },
    "publication": {
      "$ref": "#/$defs/Publication"
    },
    "library_reference": {
      "$ref": "#/$defs/LibraryReference"
    }
  },
  "required": [
    "type",
    "author",
    "publication",
    "library_reference"
  ],
  "title": "Document",
  "type": "object"
}

